import React, { Component } from 'react';
import ReactDOM from 'react-dom'
import logo from './bin.jpg';
import 'style.css'

class Bin extends Component {
    constructor() {
    super();
    this.state = {
      numInside: 0
    };
  }
  render() {
    return (
    <div>
        <img src = {logo} className = "Bin-logo" alt="logo" />
        {this.state.numInside}
    </div>
    );
  }
}

export default Bin;
